import React from 'react';
import '../styles/Footer.css';

const Footer = () => {
  return (
    <footer>
      <p>Connect with me on social media:</p>
      <ul>
        <li><a href="https://github.com/miashraf1818" target="_blank" rel="noopener noreferrer">GitHub</a></li>
        <li><a href="https://linkedin.com/in/mohammed-ikram-ashrafi-04b9a62" target="_blank" rel="noopener noreferrer">LinkedIn</a></li>
        {/* Add more social links */}
      </ul>
    </footer>
  );
};

export default Footer;
